                    "404": {
                        "description": "Not found"
                    }
                },
                "security": [
                    {
                        "OAuth2PasswordBearer": [
                            "read:settings"
                        ]
                    }
                ]
            }
        },
        "/api/v1/targets/": {
            "post": {
                "tags": [
                    "v1",
                    "v1"
                ],
                "summary": "Add targets files to Metadata. Scope: write:targets",
                "description": "Add targets files to Metadata.",
                "operationId": "post_api_v1_targets__post",
